import React, { Component } from 'react'

class LightSwitch extends Component{
    constructor(props){
        super(props);
        this.state={
            name: 'Taro',
            data: {
                height: 170,
                weight: 65
            }
        }
    }
    render(){
        return(
            <div>
                SWITCH {this.state.power? 'ON' : 'OFF'}
            </div>
        )
    }
}
export default LightSwitch;
